import React from "react";

const course = [
  {
    name: "cs5610",
    term: "20fall",
  },
  {
    name: "cs5200",
    term: "20fall",
  },
];

const CourseListComponent = ({ instructer, term }) => (
  <div>
    <h1>
      Course List (For {instructer} at {term}){" "}
    </h1>
    <table>
      <tr>Course 1</tr>
      course.map
    </table>
  </div>
);

export default CourseListComponent;
